import React, { Component } from 'react';
import { Link, Redirect } from 'react-router-dom'


class Logout extends Component {



    render() {
        return (
            <div>
                <Link style={{ cursor: "pointer" }} onClick={this.logout} >Logout</Link>
            </div>
        )
    }
}


export default Logout;
